import React, { Component } from 'react';
import Head from 'next/head';

class Footer extends Component {
    render() {
        return(
            <div>
                <Head>
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div>
                    Footer
                </div>
            </div>
        );
    }
}

export default Footer;
